import keyMirror from "keymirror";

export default keyMirror({
  UPSC_PAGE_LOADING: null,
  UPSC_PAGE_ERROR: null,
  UPSC_PAGE_LOADED: null,
  UPSC_ALL_QUESTIONS_LOADED: null,
  UPSC_SUBJECT_QUESTIONS_LOADED: null,
  UPSC_YEAR_QUESTIONS_LOADED: null,
  UPSC_YEAR_QUESTIONS_LOADED: null
});
